import Nav from "../components/Nav";
import {Container} from "../components/Atribut"
import {Typography} from '@material-ui/core';
class About extends Component {
    render() {
        return (
            <div>
                <Nav/>
                <Container>
                    <h1 style={{fontSize:"4rem"}}>Bersuara.</h1>
                    <h3 style={{lineHeight: "4vw",fontSize: "1.5rem"}} >promote your talent</h3>
                    <Typography>
                        Bersuara. 
                        merupakan platform digital yang dapat menghubungkan orang-orang bertalenta dengan orang yang membutuhkan talenta tersebut. </Typography>
                </Container>
            </div>
        );
    }
}

export default About;
